import React, { Component } from 'react'
import Navbar from 'react-bootstrap/Navbar'
import Nav from 'react-bootstrap/Nav'
import Utility from '../Utility/Utility'
import { LOCAL_STORAGE_FIRST_NAME_KEY } from '../Utility/GlobalConstants'

class HeaderComponent extends Component {
    render() {
        return (
            <header>
                <Navbar bg="dark" variant="dark">
                    <Navbar.Brand href="/home">Birthday Calendar</Navbar.Brand>
                    <Navbar.Collapse className="justify-content-end">
                        {!props.isUserLoggedIn && <Nav.Link href='/signup'>Get Started</Nav.Link>}
                        {!props.isUserLoggedIn && <Nav.Link href='/login'>Log In</Nav.Link>}
                        {props.isUserLoggedIn && <Navbar.Text>Welcome, FIRSTNAME</Navbar.Text>}
                        {props.isUserLoggedIn && <Nav.Link href='/logout'>Log Out</Nav.Link>}
                    </Navbar.Collapse>
                </Navbar>
            </header>
        )
    }
    
}

export default HeaderComponent
